import React from "react";

const CustomerList = (props) => {
  const customersList = this.props.customers.map((customer, index) => {
    return<li key={index}>{customer.name}</li>
  })
  return (
    <ul>
      {customersList}
    </ul>
  )
}

export default CustomerList;
